import React from 'react';
import './Welcome.css';

function Welcome() {
    return (
        <div className="welcome">
            <text id="line1"><span>Hi, my name is</span></text>
            <text><span>Julian Coronado.</span></text>
            <text><span>I design and develop software.</span></text>
        </div>
    );
}

export default Welcome;
